INSERT INTO `aboutus_objmv` (`id`, `img`, `title`, `heading`, `des`, `section`, `status`) VALUES
(1, 'approch-img.jpg', 'Objective', '100% Satisfaction Guarantee ', 'Our objective is to offer each truck driver with a specialized dispatcher who will ensure to find the optimum freight loads at the best price and remain you occupied on a weekly basis. Our staff of more than 20 vehicle dispatchers has been in the industry for more than 5 years and knows the best pathways in and out.', 'upper', 0),
(2, 'mission-img.jpg', 'Our Mission', 'Our global logistics\r\n                           expertise supply', 'Our mission is to build the life of a trucker as simple and stress-free as possible. We don’t work with clients; we work with partners, which means that your achievement is also our triumph. Through our dispatching services, you can increase your potential earnings. Get started right away!', 'middle', 0),
(3, 'approch-img.jpg', 'Our Vision', 'Our global logistics\r\n                           expertise supply', 'We want to fabricate the existance of a driver as straightforward and calm as could be expected. We don’t work with clients; we work with accomplices and that implies that your accomplishment is our victory', 'bottom', 0);
INSERT INTO `about_us` (`id`, `img1`, `img2`, `experience`, `title`, `des`, `projects`, `Rating`, `status`) VALUES
(1, 'pic1.webp', 'pic2.jpg', '2 Years of experience', 'A company involved in <br> Car Shipping servicing.', '<p>From door to door shipment, The Carrier\'s driver is fully authorized to transport the vehicle between the pickup and delivery addresses listed. Deposits paid are final and only partially refundable under specific conditions.\r\n                           </p>\r\n                           <p>In recognition of market dynamics and evolving transport conditions, rates may be subject to adjustments of up to thirty-five percent prior to dispatch. This ensures that the service remains aligned with current demands and operational factors.\r\n                           </p>', '200+', '5', 0);
