INSERT INTO `family_members` (`id`, `full_name`, `father_name`, `mother_name`, `birth_year`, `death_year`, `birth_place`, `generation_level`, `person_type`, `description`, `spouse_names`, `children_names`, `notable_descendants`, `created_at`, `updated_at`) VALUES
(1, 'Adam (AS)', NULL, NULL, NULL, NULL, 'Paradise (Jannah)', 1, 'prophet', 'The first human created by Allah SWT, father of all humanity. Given the knowledge of all names and appointed as the first Khalifa on earth.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(2, 'Hawwa (Eve)', NULL, NULL, NULL, NULL, 'Paradise (Jannah)', 1, 'person', 'The first woman, created from Adam (AS), mother of all humanity.', 'Adam (AS)', NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(3, 'Seth (AS)', 'Adam (AS)', 'Hawwa (Eve)', NULL, NULL, NULL, 2, 'prophet', 'Third son of Adam (AS), appointed as successor after Abel was killed. Continued the righteous lineage of prophets.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(4, 'Abel (Habil)', 'Adam (AS)', 'Hawwa (Eve)', NULL, NULL, NULL, 2, 'person', 'Second son of Adam (AS), righteous and God-fearing, killed by his brother Cain out of jealousy.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(5, 'Cain (Qabil)', 'Adam (AS)', 'Hawwa (Eve)', NULL, NULL, NULL, 2, 'person', 'First son of Adam (AS), committed the first murder by killing his brother Abel.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(6, 'Enoch (Idris AS)', 'Jared', NULL, -3382, NULL, NULL, 7, 'prophet', 'Prophet Idris, known for his wisdom and knowledge. Allah raised him to a high station.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(7, 'Noah (Nuh AS)', 'Lamech', NULL, -2948, NULL, NULL, 10, 'prophet', 'Built the ark by Allah\'s command and survived the great flood. Second father of humanity after Adam (AS).', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(8, 'Abraham (Ibrahim AS)', 'Terah (Azar)', NULL, -2166, NULL, NULL, 20, 'prophet', 'Friend of Allah (Khalilullah), father of prophets, broke the idols, built the Kaaba with Ismail (AS).', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(9, 'Ishmael (Ismail AS)', 'Abraham (Ibrahim AS)', NULL, -2080, NULL, NULL, 21, 'prophet', 'Son of Abraham (AS), ancestor of Arabs, helped build the Kaaba, father of 12 tribes.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(10, 'Isaac (Ishaq AS)', 'Abraham (Ibrahim AS)', NULL, -2066, NULL, NULL, 21, 'prophet', 'Son of Abraham (AS) and Sarah, ancestor of Israelites, father of Jacob (AS).', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(11, 'Jacob (Yaqub AS)', 'Isaac (Ishaq AS)', NULL, -2006, NULL, NULL, 22, 'prophet', 'Also called Israel, had 12 sons who became the 12 tribes of Israel.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(12, 'Joseph (Yusuf AS)', 'Jacob (Yaqub AS)', NULL, -1915, NULL, NULL, 23, 'prophet', 'Minister of Egypt, interpreter of dreams, reunited with his family after years of separation.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(13, 'Moses (Musa AS)', 'Imran (Amram)', NULL, -1391, NULL, NULL, 26, 'prophet', 'Led the Israelites out of Egypt, received the Torah, spoke directly with Allah on Mount Sinai.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(14, 'Aaron (Harun AS)', 'Imran (Amram)', NULL, -1394, NULL, NULL, 26, 'prophet', 'Brother of Moses (AS), first High Priest of Israelites, helped Moses in his mission.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(15, 'David (Dawud AS)', 'Jesse (Yishai)', NULL, -1040, NULL, NULL, 30, 'prophet', 'King of Israel, received the Psalms (Zabur), defeated Goliath, known for his beautiful voice in worship.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(16, 'Solomon (Sulaiman AS)', 'David (Dawud AS)', NULL, -1011, NULL, NULL, 31, 'prophet', 'Son of David (AS), wisest king, ruled over humans, jinn, and animals, built the First Temple.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(17, 'Jesus (Isa AS)', 'None (Virgin Birth)', NULL, -4, NULL, NULL, 42, 'prophet', 'Born to Virgin Mary (Maryam), performed miracles, will return before Day of Judgment.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(18, 'Muhammad (SAW)', 'Abdullah ibn Abdul Muttalib', NULL, 570, NULL, NULL, 44, 'prophet', 'The final messenger of Allah, seal of all prophets, received the Holy Quran, born in Mecca.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(19, 'Ali ibn Abi Talib (RA)', 'Abu Talib ibn Abdul Muttalib', NULL, 601, NULL, 'Mecca', 44, 'companion', 'Cousin and son-in-law of Prophet Muhammad (SAW), fourth Caliph, father of Hassan and Hussain.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(20, 'Abu Bakr As-Siddiq (RA)', 'Abu Quhafa', NULL, 573, NULL, 'Mecca', 44, 'companion', 'Best friend of Prophet Muhammad (SAW), first Caliph, first man to accept Islam.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(21, 'Umar ibn Al-Khattab (RA)', 'Khattab ibn Nufayl', NULL, 584, NULL, 'Mecca', 44, 'companion', 'Second Caliph, known as Al-Faruq, expanded Islamic empire significantly.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(22, 'Uthman ibn Affan (RA)', 'Affan ibn Abi al-As', NULL, 579, NULL, 'Mecca', 44, 'companion', 'Third Caliph, compiled the Quran into one book, known as Dhun-Nurayn.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(23, 'Fatimah bint Muhammad (RA)', 'Muhammad (SAW)', NULL, 605, NULL, 'Mecca', 45, 'companion', 'Daughter of Prophet Muhammad (SAW), wife of Ali (RA), mother of Hassan and Hussain.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(24, 'Hassan ibn Ali (RA)', 'Ali ibn Abi Talib (RA)', NULL, 625, NULL, 'Medina', 46, 'person', 'Grandson of Prophet Muhammad (SAW), elder son of Ali (RA) and Fatimah (RA).', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(25, 'Hussain ibn Ali (RA)', 'Ali ibn Abi Talib (RA)', NULL, 626, NULL, 'Medina', 46, 'person', 'Grandson of Prophet Muhammad (SAW), younger son of Ali (RA) and Fatimah (RA), martyred at Karbala.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(26, 'Imam Abu Hanifa (RH)', NULL, NULL, 699, NULL, 'Kufa', 52, 'scholar', 'Great Islamic scholar, founder of Hanafi school of jurisprudence.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(27, 'Imam Malik ibn Anas (RH)', NULL, NULL, 711, NULL, 'Medina', 53, 'scholar', 'Founder of Maliki school of Islamic jurisprudence, author of Al-Muwatta.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(28, 'Imam Ash-Shafi\'i (RH)', NULL, NULL, 767, NULL, 'Gaza', 54, 'scholar', 'Founder of Shafi\'i school of jurisprudence, student of Imam Malik.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(29, 'Imam Ahmad ibn Hanbal (RH)', NULL, NULL, 780, NULL, 'Baghdad', 55, 'scholar', 'Founder of Hanbali school of jurisprudence, compiler of Musnad Ahmad.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18'),
(30, 'Salahuddin Al-Ayyubi (RH)', NULL, NULL, 1137, NULL, 'Tikrit', 58, 'ruler', 'Kurdish Muslim leader, recaptured Jerusalem from Crusaders, known for his justice and mercy.', NULL, NULL, NULL, '2025-09-11 07:35:18', '2025-09-11 07:35:18');
INSERT INTO `faq` (`id`, `qus_no`, `qus`, `ans`, `qus_collapse1`, `qus_collapse2`) VALUES
(1, 'headingOne', 'servicing time frame', 'The typical servicing time frame for car shipment ranges from 1 to 10 days, depending on the distance, route, and carrier availability. Expedited shipping may reduce this to 1–3 days, while coast-to-coast transport can take up to 7–10 days.', '#collapseOne', 'collapseOne'),
(2, 'headingTwo', 'troubleshooting process', 'The troubleshooting process for car shipment involves checking documentation, tracking status, and verifying pickup/delivery details. If issues arise, contact the carrier or broker promptly to resolve delays or address vehicle condition concerns.', '#collapseTwo', 'collapseTwo'),
(3, 'headingThree', 'terms & conditions', 'Terms and conditions for car shipment include liability coverage, pickup/delivery timelines, cancellation policies, and vehicle condition requirements. Customers must review and agree to these before transport begins.', '#collapseThree', 'collapseThree');
